<style>
       .address-sec{
        border:2px solid #0000001a;border-radius: 10px; padding: 30px 20px;margin-right: 1.5rem;
       
       }
       .tab{   height: 370px;
    overflow-y: auto;
    padding-right: 2rem;
}
       .tab::-webkit-scrollbar
{
	width: 6px;
	background-color: 
#D9D9D9;
}
.tab::-webkit-scrollbar-thumb
{
    border-radius: 10px;
	background-color: #118442;
}
.heading-add{
    
    margin: 0;
    padding-bottom: 7px;
                        position: relative;
                        border-bottom: 3px solid #0000004D;
                        width: 100%;
                        font-weight: 600; font-size:18px;
}
.heading-add:before {
                        position: absolute;
                        background: #118442;
                        height: 3px;
                        content: '';
                        width: 100px;
                        bottom: -2.1px;
                        left: 0;
                      }

                     .tab {
                        float: left;
                      
                        width:100%;
                       
                      }
                      
                      /* Style the buttons inside the tab */
                      .tab button {
                        display: block;
                        background-color:#6ea68633;
                        color:#0A4824;

                        padding: 8px 16px;
                        width: 100%;
                        border: none;
                        outline: none;
                        text-align: left;
                        cursor: pointer;
                        transition: 0.3s;
                        font-size: 16px;
                        border-radius: 30px;
                        margin-bottom: 0.5rem;
                        font-weight: 600;
                        display: flex;
                        justify-content: space-between;
                        align-items: center;

                      }
                      .tab button svg{
                        fill:#0A4824 ;
                      }
                      .tabcontent{
                        padding: 25px 0px 0px 0px;
                      }
                      .tabcontent iframe{
                        border-radius: 40px 40px 0px 0px;
                        border: 1px solid 
                        #0a48244f !important;
                      }
                      .tabcontent p{
                        display: flex;
                        gap: 12px;
                        padding: 0px 20px;
                        margin-bottom: 1rem;
                      }
                      .tabcontent p{  line-height: 1.5;
    font-size: 16px;
    font-weight: 400;
}
.tabcontent p:nth-child(3){
    margin-bottom: 2rem;
}
                      
                      /* Change background color of buttons on hover */
                      .tab button:hover,  .tab button.active {
                        background-color: #118442;
                        color: #ffff;
                      }
                      .tab button:hover svg,  .tab button.active svg {
                        fill:#ffff; ;
                      }
                     
                      .tab-sec-right{
                        border: 2px solid #11844282; border-radius: 10px ;
                      }
                      @media (max-width:576px) {
                        .address-sec {
    
    margin-right: 0rem;
}
                        
                      }
                      .contact-form {
                          width:100% !important;
                          margin-top:1rem !important;
                      }
                      .skill-two_image-box {
                          gap:0px !important;
                      }
                      .contact-form .form_control {
                          padding-bottom:18px;
                      }
                  
    </style>

